import React from 'react';

let imageArray = [];

let currentGameArray = [];

let currentScore = 0;
let highScore = 0;

const randomImage = () =>{
    console.log(imageArray);
    let randomNumber = (Math.floor(Math.random() * 49)+1);
    if(imageArray.includes(randomNumber)){
        return randomImage();
    }
    else{
        imageArray.push(randomNumber);
        return "/us-flags/"+randomNumber+".png";
    }
}

const styles = {
    container:{
        paddingTop: "50px",
        paddingBottom: "50px",
        display: "flex",
        flexWrap: "wrap",
        margin: "0 auto",
        justifyContent: "center",
    }
};

const changeImages = () =>{
    const styles = {
        images: {
            height: "150px",
            width: "150px",
            margin: "8px 25px",
            display: "block",
            backgroundImage: 'url(' + randomImage() + ')',
            backgroundSize: "contain",
            backgroundRepeat: "no-repeat",
            backgroundPosition: "center",
        }
    };
    console.log(styles);
    return styles.images;
}

const imageClicked = (e) =>{
    console.log(e.target.style.backgroundImage);
    console.log(currentGameArray);
    console.log(currentScore);
    console.log(highScore);
    let backgroundURL = e.target.style.backgroundImage;
    if(currentGameArray.includes(backgroundURL)){
        //reset score, clear array, etc
        currentScore=0;
        // highScore=0;
        currentGameArray=[];
        document.getElementById("game-scores").innerHTML = "Score: "+currentScore+" | Top Score: "+highScore;
    }
    else{
        currentGameArray.push(backgroundURL);
        currentScore++;
        if(currentScore>=highScore){
            highScore=currentScore;
        }
        document.getElementById("game-scores").innerHTML = "Score: "+currentScore+" | Top Score: "+highScore;
    }
    shuffleBoard();
};

const shuffleBoard = (elems) => {
    const allElems = () => {
        var ret = [], l = elems.length;
        while (l--) { ret[ret.length] = elems[l]; }
        return ret;
    }
    var shuffled = (function(){
        var l = allElems.length, ret = [];
        while (l--) {
            var random = Math.floor(Math.random() * allElems.length),
                randEl = allElems[random].cloneNode(true);
            allElems.splice(random, 1);
            ret[ret.length] = randEl;
        }
        return ret; 
    })(), l = elems.length;
    while (l--) {
        elems[l].parentNode.insertBefore(shuffled[l], elems[l].nextSibling);
        elems[l].parentNode.removeChild(elems[l]);
    }

}


function Game (){
    changeImages();
    return(
        <main className="container gameBoard" style={styles.container}>
